INSERT INTO `blogs` (`id`, `category_id`, `title`, `slug`, `details`, `thumbnail`, `photos`, `tags`, `type`, `created_at`, `updated_at`) VALUES
(5, 'Politics', '20 Most Beautiful Travel Blogs In 2022', '20-most-beautiful-travel-blogs-in-2022', '<p><strong>Update 2021:</strong> Due to how popular this article has become, I have decided to keep this article alive and will continue to add more beautiful travel blogs as I discover it.</p><p>2020 has come, maybe not with a bang as a lot of us may have hoped, but the world goes on and as such I have decided to extend this most beautiful travel blogs list even further with 6 new travel blogs to check out, bringing it to 20, a perfect number for the 2020 year. Without further ado, let\'s check out all the beautiful travel blogs out there.</p><p>As some of you may know, I have been in the design industry for the past 10 years working as a freelance designer in various companies while also running this blog. In fact, the majority of my income is mostly from my design freelance work over at The Pete Design.</p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 50%; float: right;\" data-filename=\"fine.jpg\" class=\"note-float-right\"></p><p>I value well-designed products and today, I want to dive down into the design of travel blogs and featured the best design travel blogs out there that take storytelling to the next level and hopefully inspire you to create an awesome travel blog of your own.</p><p><strong>Tips:</strong> Did you know that you can start a travel blog for as low as 3 USD per month? If you are looking to start a travel blog and are looking to save some cost, I highly recommend you check out <a href=\"https://partners.hostgator.com/c/1262409/177309/3094\"><strong>Hostgator</strong></a>.</p><p><br></p><p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/arlawWou2BU\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p><p>ver el <a href=\"https://twitter.com/CFKArgentina/status/1502222806058254336\" target=\"_blank\">tweet de Cristina</a><br></p>', 'oBoA3VLTPNZ3VD-1.jpg', '[\"RxuE44292623_399451020592905_6536115609442328805_n7d5a.jpg\",\"F1Dm44371528_263042657731432_6452096443180721983_n7d5a.jpg\",\"jhSz44898222_267175490542576_6183516087002698981_n7d5a.jpg\",\"FuRv45313783_2158345917812845_5821103427645807423_n7d5a.jpg\"]', 'Política,Opinión,CFK', 'new', '2022-03-12 07:58:49', '2022-03-17 03:45:57');
INSERT INTO `blogs` (`id`, `category_id`, `title`, `slug`, `details`, `thumbnail`, `photos`, `tags`, `type`, `created_at`, `updated_at`) VALUES
(7, 'Politics', 'It\'s fine.', 'its-fine', '<p>Aunque <a href=\"https://miguel.futureinltd.com/about\">cumple </a>una función social y es normal que la percibamos, sentir culpa en exceso altera nuestra calidad de vida, y hasta se relaciona con la depresión y la ansiedad. <strong>En esta nota, lectoras cuentan experiencias de culpa sin sentido, desde alguien en su condición de esposa y madre a quienes sienten culpa desde su lugar de hijas o por tener una discapacidad.</strong></p><blockquote><p>Aunque cumple una función social y es normal que la percibamos, sentir culpa en exceso altera nuestra calidad de vida, y hasta se relaciona con la depresión y la ansiedad. En esta nota, lectoras cuentan experiencias de culpa sin sentido, desde alguien en su condición de esposa y madre a quienes sienten culpa desde su lugar de hijas o por tener una discapacidad.</p></blockquote><figure class=\"media\"><oembed url=\"https://www.youtube.com/watch?v=_JuSfjT_bqg\"></oembed></figure><p>Aunque cumple una función social y es normal que la percibamos, sentir culpa en exceso altera nuestra calidad de vida, y hasta se relaciona con la depresión y la ansiedad. <i>En esta nota, lectoras cuentan experiencias de culpa sin sentido, desde alguien en su condición de esposa y madre a quienes sienten culpa desde su lugar de hijas o por tener una discapacidad.</i></p><p> </p>', 'AZf8fine.jpg', '[\"l1Lufine.jpg\"]', 'cristina jony viale cumple ln', 'new', '2022-03-12 09:35:19', '2022-03-17 03:44:50');

